B.aHm=new A.v("Material Design 3",null,null,null,null,null,null,null,null,null,null)
B.aE4=new A.v("The in Flutter 2.10.0 introduced Material 3 ColorScheme is used and fully supported. However, components in Flutter 2.10.x do not yet use any of the updated ColorScheme's new colors by default. When you enable FlexColorScheme's component sub-themes you get a theme that is close to the Material 3 style by default. With the component sub-themes settings you can adjust it further, and e.g. change which ColorScheme color each component uses. This is a convenient way to select and use any ColorScheme based color, as the themed color for components included in FlexColorScheme's supported component theme customization capabilities.\n\nVery few Material 3 widgets and styles are available in Flutter 2.10.x and earlier. The updated ColorScheme, NavigationBar and a flag to use a selection indicator on NavigationRail are the only current M3 features.\n\nThere is a toggle in ThemeData that you can turn on to enable available built-in M3 styles in Flutter. It still has almost no effect on UI widget defaults in Flutter. The indicator on the NavigationRail is the only thing it affects so far. It will be used more in future Flutter versions. When it is, we can use the toggle here to see what it does.",null,null,null,null,null,null,null,null,null,null)
