B.aHt=new A.v("With component themes enabled you can select scheme color for the tab items and indicator separately. Using TabBarStyle conveniently syncs the TabBar to active AppBar or surface theme, but this offers more options if that is needed. These settings override used TabBarStyle, set them back to default to use TabBarStyle again.",null,null,null,null,null,null,null,null,null,null)
