B.aEt=new A.v("Material Design 2 guide briefly mentions using surfaces with primary color alpha blends. FlexColorScheme surface blends implements it.\n\nMaterial Design 3 has a new color system where a hint of primary color is also used on surfaces. It is done via its neutral tonal palettes that are shifted slightly towards the primary color. If you use M3 seeded ColorSchemes and set blend level to zero, you get the M3 design. With surface blends, you can further strengthen the effect and vary blend levels by surface type.",null,null,null,null,null,null,null,null,null,null)
