B.aEl=new A.v("The opinionated component widget sub theming is ON by default in this app, but OFF by default in the API.  When OFF, FlexColorScheme mostly only harmonize the colors and you can adjust a few common sub-theme properties, like AppBar, see docs to find out more.\n\nThe default sub-theming follows Material Design 3 guideline when possible. It is however still limited by Flutter Material 2 based theming designs. Most visible change is the corner radius on Widgets that depends on Widget type, but also font sizes in the TextTheme.",null,null,null,null,null,null,null,null,null,null)
